import React, { FC } from 'react';
import ReactDOM from 'react-dom';

interface Props {
  name: string;
}

const Hello: FC<Props> = props => {
  return (
    <div>
      <p>Hello {props.name}</p>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="hoge" />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
